package String_prg;

public class Print_Alphabet_A_to_Z {

	public static void main(String[] args) {
		char alphabet='a';
		for(int i=0;i<26;i++)
		{
			System.out.print((char)(alphabet+i)+" ");
		
		}
		System.out.println();
		char capital='A';
		for(int i=0;i<26;i++)
		{
			System.out.print((char)(capital+i)+" ");
		
		}
		// TODO Auto-generated method stub

	}

}
